INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100101, 155, "ヒヨリ", 27, 2, "人助けが大好き！　前向き格闘娘", "東山奈央", "A", "獣人族", "人助け、応援", 44, 8, 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, "トゥインクルウィッシュ");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100201, 158, "ユイ", 5, 2, "戦闘のサポートが得意な、心優しい少女", "種田梨沙", "O", "ヒューマン", "料理、人間観察", 47, 4, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, "トゥインクルウィッシュ");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100301, 163, "レイ", 12, 2, "クールで何事にも真っ直ぐな剣士", "早見沙織", "B", "魔族", "読書、乗馬、お茶", 46, 1, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, "トゥインクルウィッシュ");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100401, 128, "ミソギ", 10, 5, "探検好きのイタズラっ子", "諸星すみれ", "O", "ヒューマン", "いたずら、探検", 27, 8, 0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 9, "リトルリリカル");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100501, 146, "マツリ", 25, 8, "ヒーローに憧れる騎士見習いの少女", "下田麻美", "O", "獣人族", "ヒーローごっこ", 40, 11, 0, "？？？", 12, "王宮騎士団（NIGHTMARE）");
