INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100701, 130, "ミヤコ", 23, 7, "プリン大好きゴースト娘", "雨宮天", "B", "魔族", "プリンを食べること", 32, 1, 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 14, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100801, 150, "ユキ", 10, 15, "ボクは誰よりも美しい", "大空直美", "AB", "エルフ", "鏡で自分を見ること", 40, 10, 0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 14, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100901, 159, "アンナ", 5, 13, "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", "A", "魔族", "小説執筆", 45, 7, 0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 17, "トワイライトキャラバン");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (101001, 155, "マホ", 22, 10, "マホマホ王国のプリンセス", "内田真礼", "O", "獣人族", "空想、ぬいぐるみ集め", 42, 9, 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 16, "自警団（カォン）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (101101, 156, "リノ", 25, 3, "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", "A", "ヒューマン", "お裁縫", 44, 8, 0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 15, "ラビリンス");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (101201, 156, "ハツネ", 24, 6, "みんなのために超能力を使う眠り姫", "大橋彩香", "A", "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 46, 12, 0, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 17, "フォレスティエ");
