INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (101601, 167, "スズナ", 10, 14, "天真爛漫で人気者のカリスマモデル", "上坂すみれ", "O", "魔族", "ファッション", 48, 4, 0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 17, "ルーセント学院");
