INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (101801, 162, "イオ", 14, 14, "多くの男性を魅了する無垢な女教師", "伊藤静", "B", "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 52, 8, 0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 23, "ルーセント学院");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102001, 117, "ミミ", 3, 5, "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", "O", "獣人族", "かわいいもの集め", 21, 4, 0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 10, "リトルリリカル");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102101, 150, "クルミ", 9, 9, "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", "B", "ヒューマン", "観劇、おままごと", 40, 6, 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, "サレンディア救護院");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102201, 150, "ヨリ", 22, 7, "人見知りであまのじゃくな女の子", "原紗友里", "O", "魔族", "ゲーム全般", 40, 11, 0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 13, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102301, 148, "アヤネ", 10, 9, "ぷうきちといつも一緒！", "芹澤優", "B", "ヒューマン", "屋内でできる遊び", 38, 5, 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, "サレンディア救護院");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102501, 154, "スズメ", 12, 9, "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", "O", "ヒューマン", "ご奉仕", 43, 12, 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 15, "サレンディア救護院");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102601, 144, "リン", 1, 11, "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", "B", "獣人族", "あんパン", 42, 1, 0, "test", 17, "牧場（エリザベスパーク）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102701, 154, "エリコ", 30, 13, "運命の相手に一途すぎる乙女", "橋本ちなみ", "B", "魔族", "実験、裁縫、料理", 43, 7, 0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, "トワイライトキャラバン");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102801, 156, "サレン", 4, 9, "救護院を経営する優しい庶民派お嬢様", "堀江由衣", "A", "エルフ", "経営、お茶会", 43, 10, 0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 17, "サレンディア救護院");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (102901, 157, "ノゾミ", 24, 4, "歌って踊れる大人気アイドル", "日笠陽子", "B", "ヒューマン", "舞台鑑賞、ダンス", 40, 1, 0, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 17, "カルミナ");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (103001, 163, "ニノン", 31, 15, "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", "O", "ヒューマン", "忍法開発", 51, 8, 0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 16, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (103101, 157, "シノブ", 22, 7, "占いが得意な霊能少女", "大坪由佳", "AB", "魔族", "占い", 42, 12, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 18, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (103201, 157, "アキノ", 12, 12, "一人前の商人を目指すパワフルお嬢様", "松嵜麗", "AB", "ヒューマン", "慈善事業", 45, 3, 0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 18, "メルクリウス財団");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (103301, 142, "マヒル", 3, 11, "みんなを笑顔にするお笑い牧場主", "新田恵海", "B", "ヒューマン", "漫才", 35, 3, 0, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 20, "牧場（エリザベスパーク）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (103401, 164, "ユカリ", 16, 12, "純情でほっとけない大人の女性", "今井麻美", "A", "エルフ", "ウインドーショッピング", 55, 3, 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 22, "メルクリウス財団");
