INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (103801, 153, "シオリ", 3, 11, "読書が趣味の病弱少女", "小清水亜美", "A", "獣人族", "読書、お散歩", 40, 11, 0, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 14, "牧場（エリザベスパーク）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (104001, 158, "アオイ", 6, 6, "「友達」に憧れる、エルフの森の女の子", "花澤香菜", "AB", "エルフ", "友達作りのイメトレ", 44, 6, 0, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 13, "フォレスティエ");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (104201, 163, "チカ", 3, 4, "人々を守るために歌う、唱喚士の少女", "福原綾香", "O", "ヒューマン", "各種楽器", 46, 6, 0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, "カルミナ");
