INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (104501, 157, "クウカ", 19, 15, "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", "AB", "ヒューマン", "小説を読むこと", 49, 11, 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 18, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (104601, 158, "タマキ", 1, 12, "弱きを助け強きをくじく猫娘", "沼倉愛美", "AB", "獣人族", "猫とたわむれること", 48, 3, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 19, "メルクリウス財団");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (104701, 171, "ジュン", 25, 8, "素顔を見せない冷静沈着な女性騎士", "川澄綾子", "A", "ヒューマン", "格闘技、湯浴み", 50, 10, 0, "？？？", 25, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (104801, 163, "ミフユ", 11, 12, "仕事も私事も効率優先な傭兵少女", "田所あずさ", "O", "ヒューマン", "傭兵などのアルバイト", 49, 11, 0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 20, "メルクリウス財団");
